import React from 'react';

const AnimalSidebar = () => {
  return (
    <div>
      <h5 className="font-bold mb-2">Animales</h5>
      <ul className="space-y-2">
        <li><a href="#" className="text-blue-500 hover:underline">Perros en adopción</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Gatos en adopción</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Casos urgentes</a></li>
        <li><a href="#" className="text-blue-500 hover:underline">Animales adoptados</a></li>
      </ul>
    </div>
  );
};

export default AnimalSidebar;
